import React from 'react';

const ContactPage: React.FC = () => {
  return (
    <div style={{ padding: '2rem', textAlign: 'center' }}>
      <h1 style={{ color: '#60a5fa' }}>Contact Us</h1>
      <p>Enhanced contact page coming soon...</p>
    </div>
  );
};

export default ContactPage;
